import React from "react";
import "./Projects.css";

const projects = [
  {
    id: 1,
    title: "Aurora Sky",
    image: "/path/to/aurora-image.jpg",
  },
  {
    id: 2,
    title: "Policy Research",
    image: "/path/to/policy-research-image.jpg",
  },
  {
    id: 3,
    title: "Nebula",
    image: "/path/to/nebula-image.jpg",
  },
  {
    id: 4,
    title: "Solar System",
    image: "/path/to/solar-system-image.jpg",
  },
  {
    id: 5,
    title: "Outsource Confidence",
    image: "/path/to/outsource-image.jpg",
  },
  {
    id: 6,
    title: "Learning Platform",
    image: "/path/to/learning-platform-image.jpg",
  },
];

const Projects = () => {
  return (
    <div className="project-cards">
      {projects.map((project) => (
        <div className="card" key={project.id}>
          <img src={project.image} alt={project.title} className="card-image" />
          <div className="card-title">{project.title}</div>
        </div>
      ))}
    </div>
  );
};

export default Projects;
